function dropdown2(props) {
  const position = {
    details: "relative",
    div: "absolute",
  };
  return (
    <details className={position.details}>
      <summary className={position.summary}>
        <p>{props.heading}</p>
      </summary>
      <div className={position.div}>
        {props.text.map((item, index) => (
          <p key={index}>{item}</p>
        ))}
      </div>
    </details>
  );
}

export default dropdown2;
